/*=============== BTN QUANTITY ===============*/
var btnPlus = document.querySelectorAll(".quantity__plus");
var btnMoins = document.querySelectorAll(".quantity__moins");
var total = document.querySelector(".total__price");
var quantity1 = document.querySelector("#quantity1");
var quantity2 = document.querySelector("#quantity2");
total.innerHTML = "$" + (Number(quantity1.value) * 54.99 + Number(quantity2.value) * 74.99);
btnPlus.forEach(function (btn) {
  return btn.addEventListener("click", function (event) {
    switch (btn.dataset.id) {
      case quantity1.id:
        quantity1.value = Number(quantity1.value) + 1;
        break;
      case quantity2.id:
        quantity2.value = Number(quantity2.value) + 1;
        break;
    }
    total.innerHTML = "$" + (Number(quantity1.value) * 54.99 + Number(quantity2.value) * 74.99);
  });
});
btnMoins.forEach(function (btn) {
  return btn.addEventListener("click", function (event) {
    switch (btn.dataset.id) {
      case quantity1.id:
        if (Number(quantity1.value) > 1) {
          quantity1.value = Number(quantity1.value) - 1;
        }
        break;
      case quantity2.id:
        if (Number(quantity2.value) > 1) {
          quantity2.value = Number(quantity2.value) - 1;
        }
        break;
    }
    total.innerHTML = "$" + (Number(quantity1.value) * 54.99 + Number(quantity2.value) * 74.99);
  });
});
