var form = document.querySelector("form");
var validation = document.querySelector("#validation");
var errors = [];
form.addEventListener("submit", function (event) {
  event.preventDefault();
  var formData = new FormData(form);
  var data = Object.fromEntries(formData.entries());
  if (formIsValid(data)) {
    validation.classList.add("ok");
    validation.classList.remove("ko");
    validation.innerHTML = "<li>Your order has been validated</li>";
  }
  console.log(data);
});
var formIsValid = function formIsValid(data) {
  if (!data.address || !data.city || !data.country || !data.email || !data.name || !data.phone || !data.postal) {
    errors.push("You must fill in all the fields");
  } else {
    errors = [];
  }
  if (errors.length) {
    var errorHTML = "";
    errors.forEach(function (e) {
      errorHTML += "<li>".concat(e, "</li>");
    });
    validation.classList.remove("ok");
    validation.classList.add("ko");
    validation.innerHTML = errorHTML;
    return false;
  } else {
    validation.innerHTML = "";
    return true;
  }
};
